import React from "react";

export default function Background() {
  return (
    <section className="background">
      <div className="container">
        <div className="background__slowgan">
          <h2 className="background__slowgan-title">
            enjoy <br />
            the world
            <br /> in a healthy way
          </h2>
        </div>
      </div>
    </section>
  );
}
